model
```php
<?php
ini_set('upload_max_size', 1048);
ini_set('upload_allowed', true);
ini_set('file_uploads', true);

$upload_dir = '/uploads/';
$upload_name = $_FILES['upload']['name'];
$upload_type = $_FILES['upload']['type'];
$upload_size = $_FILES['upload']['size'];
$upload_tmp_name = $_FILES['upload']['tmp_name'];
$upload_error = $_FILES['upload']['error'];

if (!$upload_error) {
    $upload_errors = array();
    $upload_errors = array(
        'upload_too_large' => 'File too large',
        'upload_too_many_files' => 'Too many files',
        'upload_invalid_filesize' => 'Invalid file size',
        'upload_invalid_mime_type' => 'Invalid file mime type',
        'upload_invalid_filename' => 'Invalid file name',
        'upload_invalid_extension' => 'Invalid file extension',
        'upload_not_allowed' => 'File not allowed',
    );
    $upload_error_code = $upload_errors[$upload_error];

    if ($upload_error_code) {
        echo 'Error: ' . $upload_error_code;
    } else {
        $upload_name = uniqid() . '.' . $upload_type;
        $upload_url = $upload_dir . $upload_name;
        move_uploaded_file($_FILES['upload']['tmp_name'], $upload_url);
        echo 'File uploaded successfully: ' . $upload_name;
    }
} else {
    echo 'Error: ' . $upload_error;
}
```

This code will upload a file to the specified directory on the server. It will also generate a unique file name for the uploaded file. The code will check if the file is too large, too many files, invalid file size, invalid file mime type, invalid file name, invalid file extension, or not allowed. If the file is invalid, the code will return an error message. If the file is valid, the code will move the uploaded file to the specified directory

